import React from 'react'
import './navbar.css'
import image from "../images/sidebar-top.png"

export default function navbar() {
    return (
        <div className='navbar'>
            <img className='sidebar-top' src={image} alt='functional-strength-training-with-kara'>
            </img>

        </div>
    )
}
